// SSR Components
import React from "react";
import Navigation from "../components/Navigation/Navigation";
import dynamic from "next/dynamic";
import Head from "next/head";
import "../assets/scss/reset.scss";
import "../assets/scss/global.scss";

// No SSR Components
const World = dynamic(() => import("../components/World/World"), { ssr: false });

class Default extends React.Component {
    render() {
        return (
            <div id="layout-default">
                <Head>
                    <script src="https://cdn.babylonjs.com/babylon.js" type="text/javascript"></script>
                    <script src="https://raw.githubusercontent.com/BabylonJS/Babylon.js/master/dist/preview%20release/materialsLibrary/babylon.gridMaterial.min.js" type="text/javascript"></script>
                </Head>
                <World />

                {/* This renders the pages' content */}
                { this.props.children }
            </div>
        );
    }
}

export default Default;
